import React from 'react';
import classes from './checkoutMenu.module.css';

function CheckoutMenu(props){
    return(
        <div className={classes.menu}>
            <div>1</div>
            <div>2</div>
            <div>2</div>
        </div>
    );
}

export default CheckoutMenu;
